import React, { useEffect } from 'react'
// import data from '../channeldata.json';
import { fetchAllChannels } from '../store/slices/channels';

const ChannelList = () => {

    const channels = [];
    useEffect(() => {
        fetchAllChannels();
    }, [])

    // console.log(channels)
    return (<>
        <div>ChannelList</div>
        {channels.map((channel, idx) => {
            return <img src={channel.image} key={idx} />
        })}
    </>)
}

export default ChannelList
